drop table if exists team;
create table team (
	id serial primary key,
	code char(3),
	name varchar(45),
	coach varchar(45),
	off_coord varchar(45),
	def_coord varchar(45),
	stadium varchar(45),
	owner varchar(45),
	gm varchar(45)
);


drop table if exists player;
create table player (
	id serial primary key,
	code char(3),
	team varchar(45),
	player varchar(45),
	num int,
	pos varchar(5),
	age int,
	years int,
	games_played int,
	games_started int,
	status varchar(5),
	height int,
	weight int,
	birth varchar(10),
	college varchar(100),
	draft_team varchar(45),
	draft_year int,
	round int,
	pick int
);

